<script>
function pickOneFrom (array) {
  const len = array.length
  if (len === 0) return ''
  const pickedIndex = Math.floor(Math.random() * len)
  return array[pickedIndex]
}
function generateFook () {
  const descriptors = ['流心', '拉絲', '極邪惡', '慢煮', '吉利']
  const garnishs = ['滷水啤', '珍珠奶茶啤', '朱古力醬', '薑檸樂', '利賓納', '薄荷啤']
  const mainDishs = ['牛扒', '炒飯', '雞球', '肉餅', '白飯']

  for (let i = 0; i < 50; i++) {  
    setTimeout(() => {
      const garnish = pickOneFrom(garnishs)
      const mainDish = pickOneFrom(mainDishs)
      const descriptor = pickOneFrom(descriptors)

      let fookFood = `${garnish}${mainDish}`
      if (Math.random() > 0.5) {
        fookFood = `${descriptor}${fookFood}`
      }
      document.getElementById('fookFood').innerHTML = fookFood
    }, Math.pow(i, 1.5) * 10 + 1000)
  }
